import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the cart element using its class and text content
    const cartElement = page.locator('div.cart:has-text("Cart")');
    await cartElement.waitFor({ state: 'visible', timeout: 5000 });
    await cartElement.click();

    // Wait for the modal content to appear (assuming the cart is empty)
    const modalContent = page.locator('div.empty-cart');
    await modalContent.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract text from the modal to verify it's open
    const extractedText = await modalContent.textContent();

    return {
      success: true,
      action: "Opened the shopping cart modal",
      extractedData: {
        modalText: extractedText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // If an error occurs, take a final screenshot for debugging
    try {
      await page.screenshot({ path: path.join(screenshotsDir, 'error_screenshot.png') });
      screenshots.push(path.join(screenshotsDir, 'error_screenshot.png'));
    } catch (e) {
      // Ignore if screenshot fails
    }
    return {
      success: false,
      action: "Failed to open the shopping cart modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
